import React from 'react';
import {StyleSheet, View} from 'react-native';
import Title from '../components/title';
import Timer from '../components/timer';

export default function Card(title, seconds) {
  return (
    <View>
      <Title title={'TEST'}/>
      <Timer timerTime={seconds}/>
    </View>
  )
};
